import React from "react";
import { SidebarContainer, FlexContainer } from "./styles";
import Logo from '../../images/Logo.svg'
import HomeIcon from '../../images/HomeIcon.svg'

export function Sidebar(){


    return (

            <SidebarContainer>
              <img 
              className={'logo'} 
              alt={"logo"}
              src={Logo} />

                <FlexContainer>
                <img
                alt={"home"}
                src={HomeIcon} />

                </FlexContainer>

            </SidebarContainer>
    )


}
